import { Avatar, Button, TextField, Checkbox, Link, Paper, Box, Grid, Typography, FormControlLabel } from '@mui/material';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';

export function SignIn() {
    const handleSubmit = (event) => {
        event.preventDefault();
        const data = new FormData(event.currentTarget);
        console.log({
          email: data.get('email'),
          password: data.get('password'),
        });
      };

    return(
        <Grid 
          item
          xs={12}
          sm={8}
          md={5}
          component={Paper}
          elevation={6} 
          square
          marginLeft={3}
          marginRight={3}
        >
          <Box
            sx={{
              my: 8,
              mx: 4,
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
            }}
          >
            <Avatar sx={{ m: 2, bgcolor: 'secondary.main' }}>
              <LockOutlinedIcon />
            </Avatar>
            <Typography component="h1" variant="h5">
              Datos de usuario
            </Typography>
            <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 1 }}>
              <TextField
                margin="normal"
                required
                fullWidth
                id="email"
                label="Correo"
                name="email"
                autoComplete="email"
                autoFocus
              />
              <TextField
                margin="normal"
                required
                fullWidth
                name="password"
                label="ConstraseÃ±a"
                type="password"
                id="password"
                autoComplete="current-password"
              />
              <FormControlLabel
                control={<Checkbox value="remember" color="primary" />}
                label="Recordar"
              />
              <Box
                sx={{
                  display: 'flex',
                  flexDirection: 'row',
                  gap: 4
                }}
              >
                <Button
                  type="button"
                  fullWidth
                  variant="contained"
                  color='error'
                  sx={{ mt: 3, mb: 2 }}
                >
                  Regresar
                </Button>
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  color='info'
                  sx={{ mt: 3, mb: 2 }}
                >
                  Regresar
                </Button>
              </Box>
            </Box>
          </Box>
        </Grid>
    );
}
